import React from 'react';
import '../../App.css';
import Cards from "../Cards";
import Footer from "../Footer";
import CardItem from "../CardItem";
import {Link} from "react-router-dom";

export default function WebDev() {
    return (
        <>
            <div className="content">
                <div className="home">
                    <h1 className="home-heading">WEB DEV</h1>
                    <p className="home-text"><br></br>Scroll through
                        my collection of Figma designs and coded sites, including this portfolio website!</p>
                </div>
            </div>
            <div className='cards'>
                <h1>Check out some of my work!</h1>
                <div className='cards__container'>
                            <Link className='cards__item__link' >
                                <figure className='cards__item__pic-wrap' >
                                    <video className='card-vid' autoPlay loop muted>
                                        <source src='images/pennapps-vid.mp4' type='video/mp4' />
                                    </video>
                                </figure>
                                <div className='card-text'>
                                    <h3>Explore the hidden waterfall deep inside the Amazon Jungle</h3>
                                    <span>Adventure</span>
                                </div>
                            </Link>
                </div>
            </div>
            <Footer />

        </>
    );
}
